import React from "react";
import { Canvas } from 'react-three-fiber';
import { House } from "./components/House/House";

function App() {
  return (
    <>
      <h1>Hola</h1>
      <Canvas>
        <ambientLight intensity={0.5}/>
        <House />
      </Canvas>
    </>
  );
}

export default App;
